							{/* <p>{props.desc2}</p> */}
							<p className='lead'>
								{/* <Button color='primary'>Learn More</Button> */}
							</p>
						</Jumbotron>
					</Col>
				</Row>
			</Container>
		</>
	);
};

export default Header;
